script: |
  super -f text -I q2311.spq | sort > q2311.out

inputs:
  - name: q2311.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) cor0 WHERE + 8 * + col1 * - 23 NOT BETWEEN ( + - col1 * - + ( + col1 ) ) AND NULL;
  - name: tab1

outputs:
  - name: q2311.out
    data: |
      51	14	96
      85	5	59
      91	47	68
